import React, {Component} from 'react';
//import ReactDOM from 'react-dom';
import logo from '../img/meketrefe.png';
import '../css/inicio.css'


class Inicio extends Component {
  constructor(props) {
      super(props);
    };
  render() {
    return (
      <div>
      <img src={logo} style={{ width: '100%'}} />
    </div>
    )
  }
}

export default Inicio;
